import React from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`
  border: solid 1px;
  
  height: auto;
`;

const Map = (props) => {
  return <>
    <Wrapper>
      <img src="assets/images/tempMap(레이아웃용).png" alt="" />
    </Wrapper>
  </>;
};

export default Map;
